def filter_html(page):
    
    #page = urllib2.urlopen(requestobj).read()
    
    from_place = ""
    to_place = ""
    fare = ""
    timing = ""
    num_stations = ""
    distance = ""
    interchange = ""
    stations = ""
    
    #find from
    start_find = page.find("<option selected=\"selected\"")
    if start_find == -1:
        return None
    start_tag = page.find(">", start_find)
    end_tag = page.find("</option>", start_tag+1)
    from_place = page[start_tag+1:end_tag]
    
    #find to
    start_to_tag = page.find("<option selected=\"selected\"", end_tag)
    start_orig_to_tag = page.find(">",start_to_tag+1)
    end_to_tag = page.find("</option>", start_orig_to_tag+1)
    to_place = page[start_orig_to_tag+1:end_to_tag]
      
    # find fare
    start_page = page.find("<span id=\"ctl00_MainContent_lblFare\"><ul><li>", end_to_tag)
    if start_page == -1:
        return None
    start_fare_word = page.find("Fare - " ,start_page)
    end_fare_word = page.find("</li>", start_fare_word+1)
    fare = page[start_fare_word+7:end_fare_word]
    
    #find timing
#    start_timing_word = page.find("Timing - " ,end_fare_word)
#    end_timing_word = page.find("</li>", start_timing_word+1)
#    timing = page[start_timing_word+9:end_timing_word]
    timing = "0"
    
    #find number of stations
#    start_numstations_word = page.find("Stations - " ,end_timing_word)
    start_numstations_word = page.find("Stations - " ,end_fare_word)
    end_numstations_word = page.find("</li>", start_numstations_word+1)
    num_stations = page[start_numstations_word+11:end_numstations_word]
    
    #find distance
    start_distance_word = page.find("Dist. - " ,end_numstations_word)
    end_distance_word = page.find("</li>", start_distance_word+1)
    distance = page[start_distance_word+8:end_distance_word]
    
    #find interchange
    start_interchange_word = page.find("Interchange - " ,end_distance_word)
    end_interchange_word = page.find("</li>", start_interchange_word+1)
    interchange = page[start_interchange_word+14:end_interchange_word]
    
    #find stations
    start_stations_word = page.find("<ul>" ,end_interchange_word)
    end_stations_word = page.find("</ul>", start_stations_word+1)
    stations = page[start_stations_word+4:end_stations_word]
    
    return from_place, to_place, fare, timing, num_stations, distance, interchange, stations
    
